import React, { useEffect, useState } from "react";
import Containeritems from "./Containeritems";
import Carouselitems from "./Carouselitems";
import PropTypes from "prop-types";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Footer from "./Footer";

function Container(props) {
  const [articles, setArticles] = useState([]);
  const [limit, setLimit] = useState(3);
  const [articles1, setArticles1] = useState([]);

  const updateData = async () => {
    const url = `https://fakestoreapi.com/products/${
      props.category ? "category/" + props.category : ""
    }?limit=${limit}`;
    let data = await fetch(url);
    let parsedData = await data.json();
    setArticles(parsedData);
    const url1 = "https://fakestoreapi.com/products";
    let data1 = await fetch(url1);
    let parsedData1 = await data1.json();
    setArticles1(parsedData1);
  };

  useEffect(() => {
    updateData();
  }, []);

  const handleNextClick = () => {
    setLimit(limit + 3);
    if (limit === 21) {
      setLimit(limit - 3);
    } else {
      updateData();
    }
  };

  const handlePrevClick = () => {
    setLimit(limit - 3);
    if (limit === 3) {
      document.getElementById("prev").disabled = true;
      setLimit(limit + 3);
    } else {
      updateData();
    }
  };

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1,
        }
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        }
      }
    ]
  };

  return (
    <>
      <div className="container d-flex justify-content-center category-title">
        <h1 style={{color:"white"}}>{props.category ? props.category : "All Products"}</h1>
      </div>
      <div className="my-4">
        <div className="container">
          <div className="row products-grid">
            {articles.map((element) => {
              return (
                <div className="col-md-4 mb-4 product-item" key={element.id}>
                  <Containeritems
                    title={element.title ? element.title.slice(0, 24) + "..." : ""}
                    imageUrl={element.image}
                    description={element.description ? element.description.slice(0, 60) + "..." : ""}
                    price={element.price ? element.price + "$" : "$"}
                    rating={element.rating.rate ? element.rating.rate : "**"}
                    reviews={element.rating.count ? element.rating.count : "**"}
                  />
                </div>
              );
            })}
          </div>
        </div>
      </div>

      <div className="container">
        <div className="container pagination-buttons d-flex justify-content-between">
          <button
            id="prev"
            type="button"
            className="btn btn-primary custom-btn"
            onClick={handlePrevClick}
          >
            &larr; Previous
          </button>
          <button
            id="nxt"
            type="button"
            className="btn btn-primary custom-btn"
            onClick={handleNextClick}
          >
            Next &rarr;
          </button>
        </div>
      </div>

      <div className="my-4 featured-products">
        <div className="container">
          <h2>Featured Products</h2>
          <div className="row">
            <Slider {...settings}>
              {articles1.map((e) => {
                return (
                  <div className="col-md-4 mb-4" key={e.id}>
                    <Carouselitems
                      title1={e.title ? e.title.slice(0, 24) + "..." : ""}
                      description1={e.description ? e.description.slice(0, 60) + "..." : ""}
                      image1={e.image}
                    />
                  </div>
                );
              })}
            </Slider>
          </div>
        </div>
      </div>
    </>
  );
}

Container.propTypes = {
  category: PropTypes.string
};

export default Container;
